import { useState, useEffect } from 'react';
import axios from 'axios';
import '../App.css';

function UpdDelFlight() {

    useEffect(() => {
        axios.get("http://localkhost:8000/admin/showFlight").then((result) => {
            console.log(result);
        })
        .catch((err) => {
            console.log(err);
        });
    }, []);
}

export default UpdDelFlight;
